var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': 'Solvespace', 'text': '', 'tags': '', 'url': 'Solvespace.html'}, {'title': '編譯', 'text': '編譯步驟: \n 先將 Y:\\portablegit\\bin\\sh.exe 改名為 sh_rename_for_solvespace.exe \n git version  查驗 git 版本 \n git clone\xa0 https: //github.com/solvespace/solvespace.git \xa0 \n cd solvespace  回solvespace原始碼目錄 \n git submodule init \n git submodule update \n edit Y:\\tmp\\solvespace\\extlib\\angle\\CMakeLists.txt comment out line 713 and 714 \n #list(APPEND ANGLE_DEFINITIONS #"-DANGLE_PRELOADED_D3DCOMPILER_MODULE_NAMES={ \\"d3dcompiler_47.dll\\", \\"d3dcompiler_46.dll\\", \\"d3dcompiler_43.dll\\" }") endif() \n 接著需要手動進行 libpng.dll.a 的編譯, 並改名為 libpng_static.a, 並放到編譯系統的 lib 目錄中 (即隨身系統的 msys64\\mingw64\\lib 目錄) \n cd solvespace \n cd extlib \n cd libpng \n mkdir build \n cd build \n 接著回到 solvespace 原始碼目錄, 建立 build 目錄後進入 build 目錄, 執行: \n cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release mingw32-make \n 編譯完成後, 可以在 build\\bin 目錄中建立 solvespace.exe, 配合相關 dll 檔案後, 即可執行. \n 40723102操作影片: \n', 'tags': '', 'url': '編譯.html'}, {'title': '操作', 'text': 'W  : 擺正視圖\xa0 \xa0  F  : 放大試圖 \n H  : 水平放置\xa0 \xa0  \xa0V  : 垂直放置\xa0 \xa0  O  : 重合\xa0 \xa0  M  : 中點\xa0 \xa0  D  : 尺寸標註 \n 40723102操作影片: \n', 'tags': '', 'url': '操作.html'}, {'title': 'V-rep', 'text': '', 'tags': '', 'url': 'V-rep.html'}, {'title': '雙輪車控制模擬', 'text': '', 'tags': '', 'url': '雙輪車控制模擬.html'}, {'title': '其他', 'text': '', 'tags': '', 'url': '其他.html'}, {'title': 'week7', 'text': '在About中加入 This is compiled by 40723102 \n 至隨身碟40723102>201906_fall>data>solvespace>src \n 找到 solvespace.cpp 檔 \n \n 用文字編輯器編輯 \n \n 完成後再編輯solvespace一次 \n cd solvespace \n cd extlib \n cd libpng \n mkdir build \n cd build \n cmake .. -G "MinGW Makefiles" -DCMAKE_BUILD_TYPE=Release mingw32-make', 'tags': '', 'url': 'week7.html'}, {'title': 'week8', 'text': 'Solvespace 繪圖驗證1 \n \n Solvespace 繪圖驗證2 \n \n', 'tags': '', 'url': 'week8.html'}, {'title': 'week9', 'text': '期中報告影片 \n \n', 'tags': '', 'url': 'week9.html'}, {'title': 'week15', 'text': 'https://youtu.be/Nrn4rwxURxU \n', 'tags': '', 'url': 'week15.html'}, {'title': 'NX簡介', 'text': 'NX歷史 \n \xa0 NX源自於美國麥道航太公司，近30年的資深CAD / CAM / CAE系統，再加上西門子在系統與設備，工程上的經驗與能力提供在加工與產品開發設計上更多的資源與整合。 \n 在CAM加工上智慧模型（MasterModel）的概念，至少包含3DCAD模型，與NC路徑的完整關聯性，並替換數據大小以及刀具路徑的管理，在高速切銷加工上提供穩定可靠與加工品質，同時針對複合銑削加工的領域提供完整的解決方案。 \n NX優點 \xa0 NX讓客戶增加新產品數量，減少30％以上的開發時間，縮短70％以上的設計分析重複作業，並減少高達90％的電腦數控（CNC）編程時間。 \n CAD \xa0• 從零件設計資料輸入開始，通常是3D CAD模型，某些情況下也可能是2D圖面。通常會需要用到3D CAD軟體以準備或調整零件設計模型，進行後續的NC編程操作。 \n CAM \xa0• NX CAM包含NC編程，後處理及工具機模擬。 \xa0• 功能完備的套件Siemens是進階工具機控制器技術及驅動設備領域的公認領導廠商。 \n NX CAD / CAM一體化的優勢 \xa0• 3D零件建模準備NX最新的CAD技術能夠NC程序設計師迅速準備零件模型，包括協力廠商的CAD模型。只要利用同步建模技術，就可以直接編輯零件模型，準備讓零件進入NC編程。 \n \xa0• NX提供一組專門的CAD功能，讓NC程序設計師能夠在建立NC操作之前快速進行分析。 \n \xa0•\xa0 建模，組立件與製圖-NX提供了當今市場上最強大的CAD功能組合。這些功能已替換NX CAM之中，且有需要的NC程序設計師使用建立零件，坯件形狀，夾治具或工具機模型以進行模擬 。 \n', 'tags': '', 'url': 'NX簡介.html'}, {'title': 'CH3', 'text': '在本章中，將學習如何在NX 12中創建和編輯草圖。 3.1概述 繪製完成，可以使用多種方法来生成3D零件： \n \n 旋轉草圖 \n 拉伸草圖 \n 草圖沿参考線进行掃掠 \n \n 3.2素描環境 在NX 12中，可以使用 兩種方法創建草圖在當前環境與應用 : 1.➢ Choose Menu →Insert 插入→Sketch草圖 2.➢ Choose Sketch in Home toolbar(直接在主工具欄中選擇草圖) 3.➢ Choose the XC-YC plane and click OK(選擇XC-YC平面並點確定) 4.➢ Click the More option in the direct sketch tool bar area(直接點擊草圖工具欄區域中的更多選項) 5.➢ Click on Open in Sketch Task Environment as shown below \n 3.3草圖曲線工具欄 包含用於創建常用類型的圖示 曲線和编辑，修剪，圆角、弧、圓等 \n 3.4約束工具欄 尺寸約束 可以通過給尺寸賦予固定實體（例如軸，平面，坐標系或模型中創建的任何現有實體幾何形狀）來消除自由度。這些尺寸可以是線性，徑向，角度等。可以在草繪過程中隨時通過雙擊尺寸來編輯尺寸值。 \n 幾何約束 除了尺寸約束之外，還可以提供一些幾何約束以消除自由度。它們包括平行的，垂直的，共線的，同心的，水平的，垂直的，等長的，等等。該軟件能夠為所選實體找到可能的約束集。例如，在下圖中的線上施加一個約束，使其平行於矩形的左側（該線最初與矩形成一定角度）。 \n 顯示草圖約束 單擊此圖標將以白色顯示與該特定草圖中的實體相關的所有選項。 \n 顯示/刪除約束 該窗口列出了與所選任何實體相關的所有約束和約束類型。可以刪除任何列出的約束或更改約束的順序。 狀態行中顯示不受約束的自由度數。所有這些都應通過應用約束來遵循嚴格的模型來刪除。 \n 3.5範例40723102操作影片 \n \n', 'tags': '', 'url': 'CH3.html'}]};